calc_rec_apr <- function(risk_level_zz, target_margin_zz,enganche_zz , term_zz, albedo_wacc_zz) {
  has_enganche <- ifelse(enganche_zz > 0, "Enganche", "Sin Enganche")
  default_table <- pricing_info_table$DefaultPremium
  default_prem <- default_table |> filter(Type == has_enganche) |> pull(risk_level_zz)
  time_prem <- pricing_info_table$TimePremiumLow$Premium[sum(pricing_info_table$TimePremiumLow$Time <= term_zz)]
  rec_apr <- albedo_wacc_zz + target_margin_zz + default_prem + time_prem
  return(rec_apr)
}

